import React, { useState } from 'react'

const Form = () => {
  const [enabled , setenabled] = useState(true)

    const toggle = ()=>{
      setenabled(true)
    }
    const change = (event)=>{
       if(event.target.value.length > 1){
         setenabled(false)
       }
    }
  return (
    <>
    <input type="text" onChange={change}/>
    <button disabled={enabled} onClick={toggle}>Click </button>
    </>
  )
}

export default Form
